import React, { useState } from 'react';
import './Category.css';

const CategoryCarousel = ({ title, category }) => {
  // States to manage the current set of images
  const [currentIndex, setCurrentIndex] = useState(0);

  // Function to go to the next set of images
  const goToNext = () => {
    if (currentIndex + 4 < category.length) {
      setCurrentIndex(currentIndex + 4);
    }
  };

  // Function to go to the previous set of images
  const goToPrev = () => {
    if (currentIndex - 4 >= 0) {
      setCurrentIndex(currentIndex - 4);
    }
  };

  // Render category items for the current set of images
  const renderCategoryItems = (items) => {
    return items.map((item, index) => (
      <div className="category-item" key={index}>
        <img src={item.image} alt={item.title} className="category-image" />
        <h4>{item.title}</h4>
        <p>{item.description}</p>
      </div>
    ));
  };

  return (
    <div className="category-section">
      <h3 className="category-title">{title}</h3>
      <div className="category-carousel">
        <button className="carousel-btn prev-btn" onClick={goToPrev}>
          ◄
        </button>
        <div className="carousel-content">
          <div className="category-row">
            {renderCategoryItems(category.slice(currentIndex, currentIndex + 4))}
          </div>
        </div>
        <button className="carousel-btn next-btn" onClick={goToNext}>
          ►
        </button>
      </div>
    </div>
  );
};

const Category = () => {
  const freeWorkout = [
    { image: '/images/free1.jpg', title: 'Free Workout 1', description: 'Description 1' },
    { image: '/images/free2.jpg', title: 'Free Workout 2', description: 'Description 2' },
    { image: '/images/free3.jpg', title: 'Free Workout 3', description: 'Description 3' },
    { image: '/images/free4.jpg', title: 'Free Workout 4', description: 'Description 4' },
    { image: '/images/free5.png', title: 'Free Workout 5', description: 'Description 5' },
    { image: '/images/free6.jpg', title: 'Free Workout 6', description: 'Description 6' },
    { image: '/images/free7.jpg', title: 'Free Workout 7', description: 'Description 7' },
    { image: '/images/free8.jpg', title: 'Free Workout 8', description: 'Description 8' }
  ];

  const paidWorkout = [
    { image: '/images/c1.jpg', title: 'Paid Workout 1', description: 'Description 1' },
    { image: '/images/c2.jpg', title: 'Paid Workout 2', description: 'Description 2' },
    { image: '/images/c3.jpg', title: 'Paid Workout 3', description: 'Description 3' },
    { image: '/images/c4.jpg', title: 'Paid Workout 4', description: 'Description 4' },
    { image: '/images/paid5.jpg', title: 'Paid Workout 5', description: 'Description 5' },
    { image: '/images/paid6.jpg', title: 'Paid Workout 6', description: 'Description 6' },
    { image: '/images/paid7.jpg', title: 'Paid Workout 7', description: 'Description 7' },
    { image: '/images/paid8.jpg', title: 'Paid Workout 8', description: 'Description 8' }
  ];

  const workoutWithNutrition = [
    { image: '/images/nutrition1.jpg', title: 'Workout with Nutrition 1', description: 'Description 1' },
    { image: '/images/nutrition2.jpg', title: 'Workout with Nutrition 2', description: 'Description 2' },
    { image: '/images/nutrition3.jpg', title: 'Workout with Nutrition 3', description: 'Description 3' },
    { image: '/images/nutrition4.jpg', title: 'Workout with Nutrition 4', description: 'Description 4' },
    { image: '/images/nutrition5.jpg', title: 'Workout with Nutrition 5', description: 'Description 5' },
    { image: '/images/nutrition6.jpg', title: 'Workout with Nutrition 6', description: 'Description 6' },
    { image: '/images/nutrition7.jpg', title: 'Workout with Nutrition 7', description: 'Description 7' },
    { image: '/images/nutrition8.jpg', title: 'Workout with Nutrition 8', description: 'Description 8' }
  ];

  const personalizedPlan = [
    { image: '/images/personalized1.jpg', title: 'Personalized Plan 1', description: 'Description 1' },
    { image: '/images/personalized2.jpg', title: 'Personalized Plan 2', description: 'Description 2' },
    { image: '/images/personalized3.jpg', title: 'Personalized Plan 3', description: 'Description 3' },
    { image: '/images/personalized4.jpg', title: 'Personalized Plan 4', description: 'Description 4' },
    { image: '/images/personalized5.jpg', title: 'Personalized Plan 5', description: 'Description 5' },
    { image: '/images/personalized6.jpg', title: 'Personalized Plan 6', description: 'Description 6' },
    { image: '/images/personalized7.jpg', title: 'Personalized Plan 7', description: 'Description 7' },
    { image: '/images/personalized8.jpg', title: 'Personalized Plan 8', description: 'Description 8' }
  ];

  return (
    <div>
      <CategoryCarousel title="Free Workout Plans" category={freeWorkout} />
      <CategoryCarousel title="Paid Workout Plans" category={paidWorkout} />
      <CategoryCarousel title="Workout with Nutrition Guidance" category={workoutWithNutrition} />
      <CategoryCarousel title="Personalized Workout Plans" category={personalizedPlan} />
    </div>
  );
};

export default Category;
